			+ "<child1>VALUE{{times}}</child1></child></root>";
	private final static String message1 = "<root><child>" + smallLoad()
			+ "<child>TEST{{times}}</child></child></root>";

	@Before
	public void setup() throws JMSException {
		postMessage("PARENT.IN.QUEUE", message1, 1000);
		postMessage("PARENT.IN.QUEUE2", message2, 1000);
		postMessage("PARENT.IN.QUEUE3", message3, 1000);
	}

	@Test
	@Ignore
	public void test() throws Exception {
		String[] args = { "-c",
				"src/test/resources/sample-configs/qPubSubConfigs.json", "-e",
				"test" };

		new Thread () {
			@Override
			public void run() {
				QPubSubMain.main(args);
			}
		}.start();

		Thread.sleep(10000);
//		QPubSubMain.stop();
		System.out.println("all done");
		Assert.assertTrue(getAllMessages("PARENT.IN.QUEUE").isEmpty());
		Assert.assertTrue(getAllMessages("PARENT.IN.QUEUE2").isEmpty());
		Assert.assertTrue(getAllMessages("PARENT.IN.QUEUE3").isEmpty());
	}

